&quot;Friday 4th: Clear bright day quite cold in the morning and at night. Staid at Genarouxs all day posting books. C. Barall &amp; Looney went to Welshes shanty with loads. Dan McElroy went to Murphys and did not return that night. Bearall &amp; Looney come back.&quot;

&quot;Saturday 5th: Bright clear morning went from Genaroux Shty to Flats with Genaroux &amp; Looney on their way home. Paid Genaroux $5.00 Dollars before starting. Stopt at Flats &amp; weight 163 27/34 Bus. Oats &amp; Locked them up &amp; brought the key with me had diner at Birdets did not pay for it. Commensed snowing about noon but did not snow much walked to Genaroux that night distance 3 miles J. Naggerty in with sleigh crooks &amp; toook beef hides from Genaroux.&quot;

&quot;Sunday 6th: Bright clear day quite warm in fournoon but snowed a little in afternoon and got cloudy. Staid at Genarouxs all day posting books. Genaroux got back about 3 p.m. from home. Finished posting all but Mellons Depot a/c &amp; teamsters &amp; mens time to date.&quot;

Part of Denis Nealon's diary.
